INSERT INTO `places` VALUES (4,13,'Molo Beverello','<p>We start our trip from the famouse place Jemaa Lefna in center of Marrakech, Crossed the highest Atlas Through pass (Tizi N Tichka)</p><p><strong>Duration: </strong>5 minutes&nbsp;<br>Admission Ticket Free</p>',1,'2022-01-05 21:09:06','2022-01-12 18:46:50'),(5,13,'Marina Piccola','<p>So we will visit the UNESCO World Heritage Site Ait Benhaddou / Official name Ksar of Ait-Ben-Haddou is located in south of Morocco, It is an ighrem (fortified village in English) (ksar in Arabic), along the former caravan route between the Sahara and Marrakech in present-day Morocco. Most citizens attracted by the tourist trade live in more modern dwellings in a village on the other side of the river, although there are four families still living in the ancient village. Inside the walls of the ksar are half a dozen (Kasbahs) or merchants houses and other individual dwellings,</p><p><strong>Duration:</strong> 1 hour 30 minutes<br>Admission Ticket Free</p>',1,'2022-01-05 21:09:42','2022-01-05 21:09:42'),(6,13,'Blue Grotto','<p>Pass trough the Ait Saouen Col in anti atlas</p>',1,'2022-01-05 21:10:49','2022-01-05 21:10:49'),(7,13,'Lorem','<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>',1,'2022-01-10 21:27:33','2022-01-17 01:54:13'),(23,13,'Grotto','<ul><li>Most citizens attracted by the tourist trade live in more modern dwellings in a village on the other side of the river.</li><li>Although there are four families still living in the ancient village.&nbsp;</li><li>Inside the walls of the ksar are half a dozen (Kasbahs) or merchants houses and other individual dwellings.</li></ul>',1,'2022-01-17 01:54:40','2022-01-19 21:16:57'),(27,14,'Marina Piccola','<p>so we will visit the UNESCO World Heritage Site Ait Benhaddou / Official name Ksar of Ait-Ben-Haddou is located in south of Morocco, It is an ighrem (fortified village in English) (ksar in Arabic), along the former caravan route between the Sahara and Marrakech in present-day Morocco. Most citizens attracted by the tourist trade live in more modern dwellings in a village on the other side of the river, although there are four families still living in the ancient village. Inside the walls of the ksar are half a dozen (Kasbahs) or merchants houses and other individual dwellings,</p><p><strong>Duration</strong>: 1 hour 30 minutes</p><p>Admission Ticket Free</p>',1,'2022-01-19 23:27:04','2022-01-19 23:27:27');
